import React from 'react';
import { directive } from '@babel/types';


class Lampada extends React.Component{
    change() {
        console.log('Change');
    }

    render() {
        return (
            <div class="{this.class}" onClick={() => { this.change() }}>
                <h1>Apagada</h1>
            </div>

        )
    }
}


export default Lampada;
